import React from "react";
import FraudIp from "./api/FraudIp";
import { useState, useEffect } from "react";
import DisplayIpData from "./components/DisplayIpData";
import "./style.css";
import SignInSide from "./components/SignInSide";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import VoiceChatBot from "./components/VoiceChatBot";
import Details from "./components/Details";

function App() {
  return (
    // <div>
    //   <header className="header">
    //     <h1>Fraud Guard</h1>
    //   </header>
    //   <div className="cards-list-wrapper">
    //     {Object.entries(ipData).map((data, i) => (
    //       <DisplayIpData key={i} data={data[1]} ip={data[0]} />
    //     ))}
    //   </div>
    // </div>
    <BrowserRouter>
      <Routes>
        <Route index path="/" element={<SignInSide />} />
        <Route path="/analysis" element={<VoiceChatBot />} />
        <Route path="/details" element={<Details />} />
        <Route path="/filteredIp" element={<Details />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
